import React, { useState } from "react";
import "./contact.css";

const ContactSection = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    message: ""
  });

  const [responseMessage, setResponseMessage] = useState("");

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const res = await fetch("http://localhost:5000/api/contact", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify(formData)
      });

      const data = await res.json();

      if (res.ok) {
        setResponseMessage("Message sent successfully!");
        setFormData({ name: "", email: "", phone: "", message: "" });
      } else {
        setResponseMessage(data.error || "Submission failed.");
      }
    } catch (err) {
      console.error("Error:", err);
      setResponseMessage("An error occurred. Please try again.");
    }
  };

  return (
    <div className="contact-container">
      {/* Wrapper for side-by-side layout */}
      <div className="map-contact-wrapper">
        {/* Map Section */}
        <div className="map-section">
          <iframe
            title="map"
            src="https://www.openstreetmap.org/export/embed.html?bbox=72.8194%2C19.1505%2C72.8750%2C19.2005&layer=mapnik"
            allowFullScreen
          ></iframe>
        </div>

        {/* Contact Details Section */}
        <div className="contact-details">
          <h2>Our Office Address</h2>
          <p>
            996/4 Shop No 1 Near ICD Container Depo Air Port Road Village & Post Dhanand Teh Depalpur District Indore Pin No 453004 Madhya Pradesh
          </p>
          <br />
          <h2>General Enquiries</h2>
          <p>Email: <a href="mailto:infozaeeshcorporation@gmail.com">infozaeeshcorporation@gmail.com</a></p>
          <br />
          <h2>Call Us</h2>
          <p><a href="tel:+918888888888">+91-9752881492</a></p>
          <br />
          <h2>Our Timing</h2>
          <p>Mon - Sun: 10:00 AM - 07:00 PM</p>
        </div>
      </div>

      {/* Contact Form Section */}
      <div className="contact-form">
        <h2>Get in Touch</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-left">
            <input
              type="text"
              name="name"
              placeholder="Full Name"
              value={formData.name}
              onChange={handleChange}
              required
            />
            <input
              type="email"
              name="email"
              placeholder="Email ID"
              value={formData.email}
              onChange={handleChange}
              required
            />
            <input
              type="tel"
              name="phone"
              placeholder="Mobile Number"
              value={formData.phone}
              onChange={handleChange}
              required
            />
          </div>
          <div className="form-right">
            <textarea
              name="message"
              placeholder="Message"
              rows="8"
              value={formData.message}
              onChange={handleChange}
              required
            ></textarea>
          </div>
          <div className="submit-btn-container">
            <button className="btn-sub1" type="submit">Submit</button>
          </div>
        </form>
        {responseMessage && <p className="form-response-message">{responseMessage}</p>}
      </div>
    </div>
  );
};

export default ContactSection;
